v.x:
var $bm_rt;
var duration = effect('Animation In Duration')(1);
var rampUp = linear(time, inPoint, $bm_sum(inPoint, duration), 0, effect('Final Opacity')(1));
var opacAmount = effect('Final Opacity')(1).valueAtTime($bm_sum(inPoint, duration));
if (time < $bm_sum(inPoint, 0.01)) {
    $bm_rt = 0;
} else {
    $bm_rt = random(rampUp, opacAmount);
}

